import React, { useState, useEffect } from 'react';
import './App.css';
import profilePhoto from './assets/images/profile-photo.jpg';
import projectImage1 from './assets/images/profile-photo.jpg'; // Add project images
import projectImage2 from './assets/images/profile-photo.jpg';
import projectImage3 from './assets/images/profile-photo.jpg';

function App() {
  const [darkMode, setDarkMode] = useState(false);
  const [selectedProject, setSelectedProject] = useState(null);

  useEffect(() => {
    const savedTheme = localStorage.getItem('theme');
    if (savedTheme === 'dark') {
      setDarkMode(true);
      document.body.classList.add('dark-mode');
    }
  }, []);

  const toggleTheme = () => {
    setDarkMode(!darkMode);
    if (!darkMode) {
      document.body.classList.add('dark-mode');
      localStorage.setItem('theme', 'dark');
    } else {
      document.body.classList.remove('dark-mode');
      localStorage.setItem('theme', 'light');
    }
  };

  const handleProjectClick = (project) => {
    setSelectedProject(project);
  };

  const handleClosePopup = () => {
    setSelectedProject(null);
  };

  return (
    <div className="App">
      <header className="App-header">
        <nav className="Navbar">
          <ul>
            <li><a href="#home">Home</a></li>
            <li><a href="#skills">Skills</a></li>
            <li><a href="#projects">Projects</a></li>
            <li><a href="#contact">Contact</a></li>
          </ul>
          <label className="Theme-toggle">
            <input type="checkbox" checked={darkMode} onChange={toggleTheme} />
            <span className="slider"></span>
          </label>
        </nav>
        <section id="home" className="Home">
          <img src={profilePhoto} alt="Profile" className="Profile-photo" />
          <h1 className="App-title">Welcome to My Portfolio</h1>
          <p className="App-intro">
            Hi, I'm Zeeshan Javaid, a passionate software developer with expertise in web and mobile applications. Explore my work and get in touch!
          </p>
        </section>
        <section id="skills" className="Skills">
          <h2>Skills</h2>
          <div className="Skills-container">
            <div className="Skills-tile">ASP.NET Development</div>
            <div className="Skills-tile">MAUI & Xamarin.Forms</div>
            <div className="Skills-tile">React & Redux</div>
            <div className="Skills-tile">SQL & Database Management</div>
            <div className="Skills-tile">Machine Learning & AI</div>
          </div>
        </section>

        <section id="projects" className="Projects">
          <h2>Projects</h2>
          <div className="container">
            <div className="row">
              <div className="col-md-3">
                <div className="Project-card">
                  <img src="path-to-project1-image.jpg" alt="Project 1" className="Project-image" />
                  <div className="Project-description">
                    <p>Short description of Project 1</p>
                    <button onClick={() => openPopup('path-to-project1-image.jpg', 'Full description of Project 1')}>
                      Read More
                    </button>
                  </div>
                </div>
              </div>
              <div className="col-md-3">
                <div className="Project-card">
                  <img src="path-to-project2-image.jpg" alt="Project 2" className="Project-image" />
                  <div className="Project-description">
                    <p>Short description of Project 2</p>
                    <button onClick={() => openPopup('path-to-project2-image.jpg', 'Full description of Project 2')}>
                      Read More
                    </button>
                  </div>
                </div>
              </div>
              <div className="col-md-3">
                <div className="Project-card">
                  <img src="path-to-project3-image.jpg" alt="Project 3" className="Project-image" />
                  <div className="Project-description">
                    <p>Short description of Project 3</p>
                    <button onClick={() => openPopup('path-to-project3-image.jpg', 'Full description of Project 3')}>
                      Read More
                    </button>
                  </div>
                </div>
              </div>
            </div>
          </div>

          {/* Popup Markup */}
          <div id="project-popup" className="Popup" style={{ display: 'none' }}>
            <div className="Popup-content">
              <button className="Popup-close" onClick={closePopup}>×</button>
              <img id="popup-image" className="Popup-image" src="" alt="Project" />
              <div id="popup-description" className="Popup-description"></div>
            </div>
          </div>
        </section>

      </header>

      {selectedProject && (
        <div className="Popup">
          <div className="Popup-content">
            <button className="Popup-close" onClick={handleClosePopup}>X</button>
            <img src={selectedProject.image} alt="Project" className="Popup-image" />
            <p className="Popup-description">{selectedProject.description}</p>
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
